TreeKEM would take one of the "node seed" discussed above and encrypt/decrypt it. For encryption/decryption it would need access to a TreeSync instance, where Node implements TreeKemNode, which in turn provides the functions that TreeKEM needs. In particular, it would have to provide access to the public keys of each node. trait TreeKemNode<KeyStore: TreeSyncKeyStore> { /// Encrypt a given plaintext to the node's public key. fn encrypt(&self, plaintext: &[u8]) -> HpkeCiphertext {} /// Decrypt a given ciphertext using the secret key corresponding to the node. fn decrypt(&self, key_store: &KeyStore, ciphertext: &HpkeCiphertext) -> Vec<u8> {}
} trait<KeyStore: TreeSyncKeyStore> TreeKem<KeyStore> { /// Create an UpdatePath by encrypting a vector of `NodeSeed`s /// to the direct path of our own leaf. fn encrypt_path(&self, path: Vec<NodeSeed>) -> Result<UpdatePath, TreeKemError> {} /// Decrypt an UpdatePath, returning the `NodeSeed` and the vector of `Node`s. fn decrypt_path(&self, key_store: KeyStore, update_path: UpdatePath) -> Result<(NodeSeed, Vec<Node>), TreeKemError> {}
